import React, { Component } from "react";

class Img extends Component {
  state = {
    myProfilImg: [
      {
        linkImgOne: "../../../images/profil.webp"
      },
      {
        linkImgTwo: "../../../images/mdOne.webp"
      },
      {
        linkImgThree: "../../../images/mdThree.webp"
      },
      {
        linkImgFour: "../../../images/mdTwo.webp"
      }
    ]
  };

  render() {
    return (
      <div>
        <img
          src="../../../images/profil.webp"
          className="card-img-top "
          alt="..."
        />
      </div>
    );
  }
}

export default Img;
